import Cards from "./Cards";

function Tours({tours ,removeTour}) {
    return (
        <div>
            <div class = "flex flex-col">
                <h2 class = "border-[7px] bord">AVTG ke Sath Ghumne Chalo</h2>
            </div>

            <div>
                {
                    tours.map((item) => {
                        return (<Cards {...item} removeTour = {removeTour}></Cards>) ;
                    })
                }
            </div>
        </div>
    ) ;
}

export default Tours;
